import React, { useState, useEffect } from "react";
import Axios from "axios";

function HomePage() {
    const [user, setUser] = useState(null);
    const [group, setGroup] = useState(null);

    useEffect(() => {
        Axios({
            method: "GET",
            withCredentials: true,
            url: "http://localhost:4000/",
        }).then((res) => {
            setUser(res.data);

            if(!res.data) {
                window.location.href = "/login"; 
            }
        });

        Axios({
            method: "GET",
            withCredentials: true,
            url: "http://localhost:4000/group",
        }).then((res) => {
            setGroup(res.data);
            console.log(res);
        });
    }, [])

    return (
        <div>
            <div>
                {user ? (

                <div>
                    <p>Welcome resident's of {user.address}</p>

                    {!group ? (
                    <div>
                        <p>Looks like u need to set up your group, click below:</p>
                        <a href="/createGroup">Create Grouup</a>
                    </div>

                    ) : (

                    <div>
                        <div>
                            <p>Household Members</p>

                            {group.members.map((item, index) => {
                                    return (
                                        <div key={index}>
                                            <p>{item["name"]}</p>
                                        </div>
                                    )
                                }
                            )}
                        </div>

                        <div>
                            <p>Chores</p>

                            {group.chores.map((item, index) => {
                                    var member = group.head + parseInt(index)

                                    if(member >= group.members.length) {
                                        member = 0
                                    }

                                    return (
                                        <div key={index}>
                                            <p>{item}</p>
                                            {<p>group.members[member]["name"]</p>}
                                        </div>
                                    )
                                }
                            )}
                        </div>
                    </div>


                    )}
                    </div>

                ) : (

                <div>
                    <h1>Welcome to household homies, please login</h1>
                    <p><a href="/login">login</a></p>
                    <p><a href="/register">register</a></p>
                </div>

                )}
            </div>
        </div>
    );
}

export default HomePage;
